const zigbeeHerdsmanConverters = require('zigbee-herdsman-converters');
const zigbeeHerdsmanUtils = require('zigbee-herdsman-converters/lib/utils');


const exposes = zigbeeHerdsmanConverters['exposes'] || require("zigbee-herdsman-converters/lib/exposes");
const ea = exposes.access;
const e = exposes.presets;
const fz = zigbeeHerdsmanConverters.fromZigbeeConverters || zigbeeHerdsmanConverters.fromZigbee;
const tz = zigbeeHerdsmanConverters.toZigbeeConverters || zigbeeHerdsmanConverters.toZigbee;
const utils = require('zigbee-herdsman-converters/lib/utils');

const ZCL_DATATYPE_UINT16 = 0x21;
const ZCL_DATATYPE_BOOLEAN = 0x10;

const reporting = require('zigbee-herdsman-converters/lib/reporting');
const {getEndpointName} = require('zigbee-herdsman-converters/lib/utils');

function EndpointByKey(key) {
    let endpoint = 0;
    switch (key) {
        case 'pump_1': 
        case 'pump_1_duration': 
        case 'beeper_on_leak': 
            endpoint = 1;
            break;
        case 'pump_2': 
        case 'pump_2_duration': 
            endpoint = 2;
        break;
        case 'pump_3': 
        case 'pump_3_duration': 
            endpoint = 3;
        break;
        case 'pump_all': 
            endpoint = 4;
        break;
        case 'beeper': 
            endpoint = 5;
        break;
        default: 
            break;
    }
    return endpoint;
}

const fz_local = {
    ws_on_off: {
        cluster: 'genOnOff',
        type: ['attributeReport', 'readResponse'],
        convert: (model, msg, publish, options, meta) => {
            const result = {};
            const endpoint = msg.endpoint.ID;
            let property = '';
            switch (endpoint) {
                case 1: 
                    property = 'pump_1';
                    break;
                case 2: 
                    property = 'pump_2';
                    break;
                case 3: 
                    property = 'pump_3';
                    break;
                case 4: 
                    property = 'pump_all';
                    break;
                case 5: 
                    property = 'beeper';
                    break;
                default: 
                    break;
            }
            const state = msg.data['onOff'] === 1 ? 'ON' : 'OFF';
            result[property] = state;
            return result;
        },
    },
    ias_alarms: {
        cluster: 'ssIasZone',
        type: 'commandStatusChangeNotification',
        convert: (model, msg, publish, options, meta) => {
            const zoneStatus = msg.data.zonestatus;
            return {
                water_leak: (zoneStatus & 1) > 0,
                empty: (zoneStatus & 1 << 1) <= 0,
            }
        },
    },
    ws_config: {
        cluster: 'genOnOff',
        type: ['readResponse'],
        convert: (model, msg, publish, options, meta) => {
            const result = {};
            if (msg.data.hasOwnProperty(0xF003)) {
                const endpoint = msg.endpoint.ID;
                let property = '';
                switch (endpoint) {
                    case 1 : 
                        property = 'pump_1_duration';
                        break;
                    case 2: 
                        property = 'pump_2_duration';
                        break;
                    case 3: 
                        property = 'pump_3_duration';
                        break;
                    default: 
                        break;
                }
                result[property] = msg.data[0xF003];
            }
            else if (msg.data.hasOwnProperty(0xF005)) {
                result['beeper_on_leak'] = ['OFF', 'ON'][msg.data[0xF005]];
            }

            return result;
        },
    }

}

const tz_local = {
    ws_on_off:{
        key: ['pump_1', 'pump_2', 'pump_3', 'pump_all', 'beeper'],
        convertSet: async (entity, key, value, meta) => {
            const state = utils.isString(meta.message[key]) ? meta.message[key].toLowerCase() : null;
            utils.validateValue(state, ['toggle', 'off', 'on']);

            await meta.device.getEndpoint(EndpointByKey(key)).command('genOnOff', state, {}, utils.getOptions(meta.mapped, entity));
        },
        convertGet: async (entity, key, meta) => {
            await meta.device.getEndpoint(EndpointByKey(key)).read('genOnOff', ['onOff']);
        },
    },
    ws_config: {
        key: ['pump_1_duration', 'pump_2_duration', 'pump_3_duration', 'beeper_on_leak'],
        convertSet: async (entity, key, rawValue, meta) => {
            if (key === 'beeper_on_leak') {
                const lookup = {'OFF': 0x00, 'ON': 0x01};
                const value = utils.getFromLookup(rawValue, lookup, Number(rawValue));
                await meta.device.getEndpoint(1).write('genOnOff', {0xF005: {value, type: ZCL_DATATYPE_BOOLEAN}});
                return { 
                    state: {[key]: rawValue}
                };
                }
            else {
                const value = rawValue;
                const endpoint = EndpointByKey(key);
                await meta.device.getEndpoint(endpoint).write('genOnOff', {0xF003: {value, type: ZCL_DATATYPE_UINT16}});
                return { 
                    state: {[key]: value}
                };
                }
        },
        convertGet: async (entity, key, meta) => {
            const endpoint = meta.device.getEndpoint(EndpointByKey(key));
            switch (key) {
            case 'beeper_on_leak': 
                await endpoint.read('genOnOff', [0xF005]);
            break;
            case 'pump_1_duration': 
            case 'pump_2_duration': 
            case 'pump_3_duration': 
                await endpoint.read('genOnOff', [0xF003]);
                break;
            default:
                break;
            }
        },
    },
}


const device = {
    zigbeeModel: ['Water_Station'],
    model: 'Water_Station',
    vendor: 'Bacchus',
    description: 'Water Station',
    fromZigbee: [fz.ignore_basic_report, fz_local.ws_on_off, fz_local.ias_alarms, fz_local.ws_config],
    toZigbee: [tz_local.ws_on_off, tz_local.ws_config],

	configure: async (device, coordinatorEndpoint) => {
		const firstEndpoint    = device.getEndpoint(1);
		const secondEndpoint   = device.getEndpoint(2);
		const thirdEndpoint    = device.getEndpoint(3);
		const fourthEndpoint   = device.getEndpoint(4);
		const fifthEndpoint    = device.getEndpoint(5);
		const sixthEndpoint    = device.getEndpoint(6);

        const overrides = { min: 0, max: 3600, change: 0};

        await reporting.bind(firstEndpoint, coordinatorEndpoint, ['genOnOff']);
        await reporting.onOff(firstEndpoint, overrides);

        await reporting.bind(secondEndpoint, coordinatorEndpoint, ['genOnOff']);
        await reporting.onOff(secondEndpoint, overrides);

        await reporting.bind(thirdEndpoint, coordinatorEndpoint, ['genOnOff']);
        await reporting.onOff(thirdEndpoint, overrides);

        await reporting.bind(fourthEndpoint, coordinatorEndpoint, ['genOnOff']);
        await reporting.onOff(fourthEndpoint, overrides);

        await reporting.bind(fifthEndpoint, coordinatorEndpoint, ['genOnOff']);
        await reporting.onOff(fifthEndpoint, overrides);

        await reporting.bind(sixthEndpoint, coordinatorEndpoint, ['genOnOff', 'ssIasZone']);

        await firstEndpoint.read('genOnOff', ['onOff']);
        await firstEndpoint.read('genOnOff', [0xF003]);
        await firstEndpoint.read('genOnOff', [0xF005]);

        await secondEndpoint.read('genOnOff', ['onOff']);
        await secondEndpoint.read('genOnOff', [0xF003]);

        await thirdEndpoint.read('genOnOff', ['onOff']);
        await thirdEndpoint.read('genOnOff', [0xF003]);

        await fourthEndpoint.read('genOnOff', ['onOff']);

        await fifthEndpoint.read('genOnOff', ['onOff']);

        await sixthEndpoint.read('ssIasZone', ['zoneStatus']);

    },
    exposes: [
        e.binary('pump_1', ea.ALL, 'ON', 'OFF').withDescription('Enable first pump'),
        e.numeric('pump_1_duration', ea.ALL).withUnit('sec').withDescription('Duration of pump 1').withValueMin(0).withValueMax(600),
        e.binary('pump_2', ea.ALL, 'ON', 'OFF').withDescription('Enable second pump'),
        e.numeric('pump_2_duration', ea.ALL).withUnit('sec').withDescription('Duration of pump 2').withValueMin(0).withValueMax(600),
        e.binary('pump_3', ea.ALL, 'ON', 'OFF').withDescription('Enable third pump'),
        e.numeric('pump_3_duration', ea.ALL).withUnit('sec').withDescription('Duration of pump 3').withValueMin(0).withValueMax(600),
        e.binary('pump_all', ea.ALL, 'ON', 'OFF').withDescription('Enable all pumps'),
        e.binary('beeper', ea.ALL, 'ON', 'OFF').withDescription('Beeper'),
        e.water_leak(), 
        e.binary('empty', ea.STATE, 'Empty', 'Full').withDescription('Indicates whether the water tank is empty'),
        e.binary('beeper_on_leak', ea.ALL, 'ON', 'OFF').withDescription('Enable beeper when water leakage detected'),
      ],
    icon: 'data:image/png;base64,',

};

module.exports = device;
